:51.516229","status":"completed"},"tags":[]},"source":["A few insights canbe obtained from the summary statistics above. These are enumerated below:\n","* The average user takes about **7,638** steps daily\n","* In terms of activity levels, a user on average spends variable amount of time engaging in different levels of activity on a daily basis:\n","    * An average of 21.16 minutes on very active (i.e., vigorous) activities\n","    * An average of 13.36 minutes on fairly active activities\n","    * An average of 192.80 minutes on lightly active activities, and\n","    * An average of 991.20 minutes **(~16.5 hours)** on sedentary activities\n","* On average, a user burns 2,304 calories daily\n","* The average daily MET value is 14.47. \n","  A MET is a ratio of your working metabolic rate relative to your resting metabolic rate. Metabolic rate is the rate of energy expended per unit of time.<sup>1,2</sup> Since a MET value of 14.47 is relatively high and approximately 70% of the day on average is spent on sedentary activities, it is likely that the MET values recorded by user Fitbit devices are inaccurate.\n","* For sleep records, a user on average spends 458.6 minutes **(~7.6 hours)** daily in bed and 419.5 minutes **(~7 hours)** asleep. Here, it can be observed that the average user spends about 39.1 minutes awake in bed. This may include time spent in bed before falling asleep, time spent awake after sleeping before getting out of bed, or sleep interruptions. "]},{"cell_type":"markdown","id":"c0a6a5e1","metadata":{"papermill":{"duration":0.165723,"end_time":"2022-01-29T16:08:52.013992","exception":false,"start_time":"2022-01-29T16:08:51.848269","status":"completed"},"tags":[]},"source":["#### Analyze activity by day of the week. \n","##### Create a new column in new daily_activity data frame for day of the week"]},{"cell_type":"code","execution_count":7,"id":"ae748cec","metadata":{"execution":{"iopub.execute_input":"2022-01-29T16:08:52.353792Z","iopub.status.bus