Minutes <- (daily_activity_4$VeryActiveMinutes) + (daily_activity_4$FairlyActiveMinutes) +\n","  (daily_activity_4$LightlyActiveMinutes) + (daily_activity_4$SedentaryMinutes)\n","head(daily_activity_4)\n","\n","# Calculate averages (means) and express as percentages of average Total Minutes\n","mean_TotalMinutes <- mean(daily_activity_4$TotalMinutes)\n","VeryActive_pct <- mean(daily_activity_4$VeryActiveMinutes) / mean_TotalMinutes * 100\n","FairlyActive_pct <- mean(daily_activity_4$FairlyActiveMinutes) / mean_TotalMinutes * 100\n","LightlyActive_pct <- mean(daily_activity_4$LightlyActiveMinutes) / mean_TotalMinutes * 100\n","Sedentary_pct <- mean(daily_activity_4$SedentaryMinutes) / mean_TotalMinutes * 100\n","\n","# Create data frame with ActivityLevel and corresponding Percentages\n","daily_activity_pie <- data.frame(\n","  ActivityLevel = c(\"Very Active Minutes\", \"Fairly Active Minutes\", \"Lightly Active Minutes\", \"Sedentary Minutes\"),\n","  Percentage = c(VeryActive_pct, FairlyActive_pct, LightlyActive_pct, Sedentary_pct))\n","head(daily_activity_pie)"]},{"cell_type":"markdown","id":"fbcf6688","metadata":{"papermill":{"duration":0.173454,"end_time":"2022-01-29T16:08:52.84602","exception":false,"start_time":"2022-01-29T16:08:52.672566","status":"completed"},"tags":[]},"source":["## Share\n","#### Create data visualizations"]},{"cell_type":"code","execution_count":8,"id":"f4153ab4","metadata":{"execution":{"iopub.execute_input":"2022-01-29T16:08:53.201106Z","iopub.status.busy":"2022-01-29T16:08:53.19885Z","iopub.status.idle":"2022-01-29T16:08:55.221366Z","shell.execute_reply":"2022-01-29T16:08:55.220866Z"},"papermill":{"duration":2.201487,"end_time":"2022-01-29T16:08:55.221549","exception":false,"start_time":"2022-01-29T16:08:53.020062","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`geom_smooth()` using formula 'y ~ x'\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/